import React, { useState } from 'react'
import styled from 'styled-components'
import Navbar from './Navbar';

function Address() {
    const [fullname ,setFullname] =useState('')
    const [phone,setPhone]=useState('')
    const [flat,setFlat]=useState('')
    const [area,setArea]=useState('')
    const [landmark,setLandmark]=useState('')
    const [city,setCity]=useState('')
    const [state,setState]=useState('')

//in here setState use to get value form text boxes
console.log(fullname);
  return (
    <Container>
         <h1>Address page</h1>
        <Navbar/>
        <Main>
        <FormContainer>
        <InputContainer>
        <p>Full Name</p>
        <input type="text"  onChance={(e)=>setFullname(e.target.value)} value={fullname}/>
        </InputContainer>
        <InputContainer>
        <p>Phone Number</p>
        <input type="text"/>
        </InputContainer>
        <InputContainer>
        <p>Flat,House no, Building,Company,Apartment </p>
        <input type="text" />
        </InputContainer>
        <InputContainer>
        <p>Area ,Colony, Street</p>
        <input type="text"  />
        </InputContainer>
        <InputContainer>
        <p>Landmark</p>
        <input type="text"  />
        </InputContainer>
        <InputContainer>
        <p>Town / City</p>
        <input type="text"/>
        </InputContainer>
        <InputContainer>
        <p>State / Province</p>
        <input type="text"  />
        </InputContainer>


        <button>Deliver to this Address</button>

        </FormContainer>


        </Main>
       
     
    </Container>
  )
}

const Container = styled.div`
    width:100%;
    height:fit-content;
    max-width:1400px;
    margin:auto;
    background-color:rgb(234,237,237);
    position:relative;
`;

const FormContainer=styled.form`
    border:1px solid lightgray;
    width:55%;
    min-width:400px;
    height:fit-content;
    display:flex;
    flex-direction:column;
    align-items:center;
    justify-content:center;
    padding:15px;
    background-color:#fff;
    margin:auto;

    button{
        align-self:flex-start;
        height:33px;
        width:250px;
        margin-top:20px;
        background-color:#ffe32a;
        border:none;
        outline:none;
        cursor:pointer;
        border-radius:5px;

    }
`;

const Main =styled.div`
    padding:15px;
`;

const InputContainer =styled.div`
    width:100%;
    padding:10px;
    p{
        font-size:14px;
        font-weight:600;
    }

    input{
        width:95%;
        height:36px;
        padding-left:5px;
        border-radius:5px;
        border:1px solid lightgray;
        margin-top:5px;

        &:hover{
            border:1px solid black;
        }
    }

`;

export default Address
